import React,{Component} from "react";

export class NewTaskForm extends React.Component {

    render() {


        return (
            <header className="header">
                <h1>todos</h1>

                <form>
                    <input
                        onChange={() => this.onLableChange}
                        className="new-todo"
                        required
                        placeholder="What needs to be done?"/>
                </form>
            </header>

        );
    };
};
